Patch Set 4: Code-Review-1

I agree with TravisT's suggestion to get "CIM" into the display_name on each of these since that's what you'll most likely see in a UI.

@Lin, could you explain your point again about why you want to use all lowercase for the property names?  I agree with Travis that the camelcase is much easier to read, and I'm not clear on why you want it all lowercase.

@Malini, I think you may need to post your request for community input on PS 3 to the mailing list, it doesn't look like too many people have seen it here.
